import { nav } from "framer-motion/client";
import React from "react";
import { link } from "react-router-dom";

export const Navbar = () =>{
    return(
        <nav>
            <ul>
                <li className="home">
                    <link>Home</link>
                </li>
                <li className="home">
                    <link>About</link>
                </li>
                <li className="home">
                    <link>Services</link>
                </li>
                <li className="home">
                    <link>Skills</link>
                </li>
                <li className="home">
                    <link>Portfolio</link>
                </li>
                <li className="home">
                    <link>Contact</link>
                </li>
            </ul>
        </nav>
    );
};
